import thumbnail1 from "./png/thumbnail3.png";
import thumbnail2 from "./png/thumbnail4.png";
import thumbnail3 from "./png/thumbnail5.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faPaintBrush,
  faPalette,
  faTag,
  faPrint,
  faLaptop,
  faChartBar,
  faMobileAlt,
  faCogs,
  faBrush,
  faFont,
} from "@fortawesome/free-solid-svg-icons";

export const projects = [
  {
    title: "Thumbnail Design",
    subtitle: "Branding",
    description:
      "A logo design project for a startup company, creating a unique and memorable brand identity.",
    image: thumbnail1,
    link: "https://reactbootcamp.com",
  },
  {
    title: "Brochure Design",
    subtitle: "Print Design",
    description:
      "A brochure design project for a real estate company, creating visually appealing and informative marketing material.",
    image: thumbnail2,
    link: "https://reactbootcamp.com",
  },
  {
    title: "Social Media Graphics",
    subtitle: "Digital Design",
    description:
      "A social media graphics design project for a fashion brand, creating engaging and consistent visual content.",
    image: thumbnail3,
    link: "https://reactbootcamp.com",
  },
];

export const testimonials = [
  {
    quote:
      "I was blown away by the quality of work and attention to detail. The designer was able to deliver a high-quality product on time and exceeded my expectations.",
    image: "https://randomuser.me/api/portraits/men/1.jpg",
    name: "Jesse Hicks",
    company: "Zoozle",
  },
  {
    quote:
      "The designer was very professional and easy to work with. They were able to understand my requirements and deliver a product that met my needs.",
    image: "https://randomuser.me/api/portraits/men/94.jpg",
    name: "Ruben Alvarez",
    company: "Dooble.io",
  },
];

export const skills = [
  { name: "Adobe Creative Suite", icon: faPaintBrush },
  { name: "Graphic Design", icon: faPalette },
  { name: "Branding", icon: faTag },
  { name: "Print Design", icon: faPrint },
